import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const data = [
  {
    name: "Winnie",
    cards: [
      "Lorem ipsum dolor.",
    "Ut enim ad minim."
    ]
  },
  {
    name: "Bob",
    cards: [
      "Lorem ipsum dolor.",
    "Ut enim ad minim."
    ]
  },
  {
    name: "Thomas",
    cards: [
      "Lorem ipsum dolor.",
    "Ut enim ad minim."
    ]
  },
  {
    name: "George",
    cards: [
      "Lorem ipsum dolor.",
    "Ut enim ad minim."
    ]
  }
]

class App extends Component {
  render() {
    return (
      <div className="App">
        {
          data.map((person, idx) => {
            return (
              <div key={`column-${idx}`} className="column">
                <h1 id={person.name}>{person.name}</h1>
                <p>Lorem ipsum dolor.</p>
                <p>Ut enim ad minim.</p>
                <button type="button">+ Add a card.</button>
              </div>
            )
          })
        }
      </div>
    );
  }
}

export default App;
